import React from "react";
import rightButton from "../images/right_button.svg";
import "../Card/Card.css"; // Ensure the styles are correctly imported

const RightBtn = ({ onClick }) => {
  return (
    <button className="rocket-card__button right" onClick={onClick}>
      <img src={rightButton} alt="Next" />
    </button>
  );
};

export default RightBtn;
